== Disestablishment of military units ==

United States Air Force units are disestablished when they (or their headquarters) are disbanded, demobilized, or (sometimes) discontinued.  Inactivation is considered a temporary measure and inactive units may be activated again.  {{cite book|last=Ravenstein|first=Charles A.|title=A Guide to Air Force Lineage and Honors|edition=2d, Revised|year=1984|publisher=USAF Historical Research Center|location=Maxwell AFB, AL|page= }} --[[User:Lineagegeek|Lineagegeek]] ([[User talk:Lineagegeek|talk]]) 16:21, 17 February 2015 (UTC)

